column13:
Tri-aza macrocycles of formula (1):
   wherein 
m and n, which may be the same of different, is each zero or an integer 1, 2, or 3; 
p is zero or an integer 1 or 2; 
q is zero or an integer from 1 to 6 inclusive; 
R¹, R² and R³, which may be the same of different, is each a hydrogen atom or a group -CO₂H or -P(O)(XH)R⁴ (where R is an oxygen or sulphur atom and R⁴ is a hydrogen atom or an alkyl or alkoxy group), with the proviso that at least one of R¹, R² and R³ is a -P(O)(XH)R⁴ group; 
L is a covalent bond or a linker group; 
Z is a hydrogen atom or a reactive functional group; 
and metal complexes and/or salts thereof; are described together with processes for their preparation and compositions containing them. The compounds are useful as imaging agents, and in the treatment of abnormal cell disorders, such as in the treatment of tumours, and may be coupled to other molecules, such as proteins, for use in diagnosis and therapy.

Tetra-aza macrocycles of formula (1)
   wherein 
m and n, which may be the same or different, is each zero or an integer 1, 2, or 3; 
d is zero or an integer 1, 2 or 3; 
q is zero or an integer from 1 to 6 inclusive; 
R, R¹, R² and R³, which may be the same or different, is each a hydrogen atom or a group -P(O)(XH)R⁴ (where X is an oxygen or sulphur atom and R⁴ is a hydrogen atom or an alkyl or alkoxy group), with the proviso that at least one of R, R¹, R² and R³ is a -P(O)(XH)R⁴ group; 
L is a covalent bond or a linker group; 
Z is a hydrogen atom or a reactive functional group; 
and metal complexes and/or salts thereof; are described together with processes for their preparation and compositions containing them. The compounds are useful for imaging and in the treatment of abnormal cell disorders, such as in the treatment of tumours, and may be coupled to other molecules, such as proteins for use in diagnosis and therapy.

